INSERT INTO `galeri` (`id_galeri`, `gambar`, `judul_gambar`, `sinopsis_gambar`, `tanggal`) VALUES
(4, 'TPS 1.jpg', 'Keadaan TPS Merjosari', 'Pada TPS Ini terlihat bahwa sampah masi menumpuk dan tidak ada penangangan.', '2022-07-01'),
(5, 'TPS 2.jpg', 'TPS deket Sardo', 'Keadaan TPS yang overload membuat pandangan tidak, sampah berserakan, bau tidak sedao, dan mengganggu masyarakat', '2022-07-02'),
(6, 'download.jpg', 'TPS Landungsari', 'Terlihat Tempat sampah pada TPS tersebut penuh dan tidak ada pengangkutan.', '2022-07-04');
INSERT INTO `konten` (`id_konten`, `judul_konten`, `sinopsis`) VALUES
(1, 'About Us', 'TrashIoT Merupakan Start Up yang bergerak pada kegiatan Lingkungan Hidup. Lebih tepatnya TrashIoT berfokus pada Pengelolaan Sampah melalui perwadahan dengan Menggunakan Tempat Pembuangan Sementara atau orang orang biasa mengenalnya dengan kata TPS\r\n\r\nPerb'),
(3, 'misi', 'Meningkatkan efektifitas pada penanggulan sampah di TPS\r\nMeningkatkan Pelayanan Kebersihan dan Pengelolaan Sampah\r\nMemperkuat Upaya Pengendalian Sampah di TPS\r\nMenjalin Kemitraan dalam Pengelolaan Lingkungan Hidup.'),
(4, 'visi', 'Institusi yang Kredibel adalah TrashIoT yang memiliki kapabilitas, dan dapat dipercaya dalam menjalankan fungsi Memonitoring Tempat Pembuangan Sementara.\r\nPengelolaan Lingkungan Hidup adalah upaya sistematis dan terpadu dalam mencegah terjadinya pencemara');
